import React from "react";
import project1 from "../img/project1.jpg";
import project2 from "../img/project2.jpg";
import project3 from "../img/project3.jpg";
import project4 from "../img/project4.jpg";
import project5 from "../img/project5.jpg";
import project6 from "../img/project6.jpg";
import project7 from "../img/project7.jpg";

export default function PortfolioPage() {
  return (
    <main className="page-with-footer">
      <section id="portfolio">
        <h1>Портфоліо</h1>
        <h2>Наші роботи</h2>
        <div className="portfolio-gallery">
          <img src={project1} alt="Проєкт 1" className="portfolio-img" data-aos="zoom-in" />
          <img src={project2} alt="Проєкт 2" className="portfolio-img" data-aos="zoom-in" />
          <img src={project3} alt="Проєкт 3" className="portfolio-img" data-aos="zoom-in" />
          <img src={project4} alt="Проєкт 4" className="portfolio-img" data-aos="zoom-in" />
          <img src={project5} alt="Проєкт 5" className="portfolio-img" data-aos="zoom-in" />
          <img src={project6} alt="Проєкт 6" className="portfolio-img" data-aos="zoom-in" />
          <img src={project7} alt="Проєкт 7" className="portfolio-img" data-aos="zoom-in" />
        </div>
      </section>
    </main>
  );
}
